import React, { Component } from "react";
import Counter from "./counter";

class Counters extends Component {
  state = {
    counters: [
      { id: 1, value: 0 },
      { id: 1, value: 9 },
      { id: 1, value: 11 },
      { id: 1, value: 9 },
    ],
  };
  render() {
    return <div>{this.state.counters.map((count) => count)}</div>;
  }
}

export default Counters;
